Fast Track (2006) 
Alternatieve titel: The Ex 

Verenigde Staten 
Komedie / Romantiek 
93 minuten 

geregisseerd door Jesse Peretz 
met Zach Braff, Amanda Peet en Jason Bateman 

Tom Reilly is een niet al te ambitieuze jongeman, die zijn rustige leventje overhoop gegooid ziet worden als zijn vrouw zwanger blijkt en daarop haar goed betaalde baan opzegt. Nu moet Tom de kostwinner worden en hij wordt min of meer gedwongen om voor zijn schoonvader te gaan werken. 

